void OAIPaymentDisputeApi::updateEvidence(const QString &payment_dispute_id, const ::OpenAPI::OptionalParam<OAIUpdateEvidencePaymentDisputeRequest> &oai_update_evidence_payment_dispute_request) {
    QString fullPath = QString(_serverConfigs["updateEvidence"][_serverIndices.value("updateEvidence")].URL()+"/payment_dispute/{payment_dispute_id}/update_evidence");
    
    
    {
        QString payment_dispute_idPathParam("{");
        payment_dispute_idPathParam.append("payment_dispute_id").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "payment_dispute_id", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"payment_dispute_id"+pathSuffix : pathPrefix;
        fullPath.replace(payment_dispute_idPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(payment_dispute_id)));
    }
    OAIHttpRequestWorker *worker = new OAIHttpRequestWorker(this, _manager);
    worker->setTimeOut(_timeOut);
    worker->setWorkingDirectory(_workingDirectory);
    OAIHttpRequestInput input(fullPath, "POST");

    if (oai_update_evidence_payment_dispute_request.hasValue()){

        
        QByteArray output = oai_update_evidence_payment_dispute_request.value().asJson().toUtf8();
        input.request_body.append(output);
    }
    for (auto keyValueIt = _defaultHeaders.keyValueBegin(); keyValueIt != _defaultHeaders.keyValueEnd(); keyValueIt++) {
        input.headers.insert(keyValueIt->first, keyValueIt->second);
    }


    connect(worker, &OAIHttpRequestWorker::on_execution_finished, this, &OAIPaymentDisputeApi::updateEvidenceCallback);
    connect(this, &OAIPaymentDisputeApi::abortRequestsSignal, worker, &QObject::deleteLater);
    connect(worker, &QObject::destroyed, this, [this]() {
        if (findChildren<OAIHttpRequestWorker*>().count() == 0) {
            Q_EMIT allPendingRequestsCompleted();
        }
    });
    _OauthMethod = 2;
    _implicitFlow.unlink();
    _credentialFlow.unlink();
    _passwordFlow.unlink();
    _authFlow.link();
    QStringList scope;
    scope.append("https://api.ebay.com/oauth/api_scope/sell.payment.dispute");
    auto token = _authFlow.getToken(scope.join(" "));
    if(token.isValid())
        input.headers.insert("Authorization", "Bearer " + token.getToken());

    _latestWorker = new OAIHttpRequestWorker(this, _manager);
    _latestWorker->setTimeOut(_timeOut);
    _latestWorker->setWorkingDirectory(_workingDirectory);

    connect(_latestWorker, &OAIHttpRequestWorker::on_execution_finished, this, &OAIPaymentDisputeApi::updateEvidenceCallback);
    connect(this, &OAIPaymentDisputeApi::abortRequestsSignal, _latestWorker, &QObject::deleteLater);
    connect(_latestWorker, &QObject::destroyed, [this](){
        if(findChildren<OAIHttpRequestWorker*>().count() == 0){
            Q_EMIT allPendingRequestsCompleted();
        }
    });

    _latestInput = input;
    _latestScope = scope;




    worker->execute(&input);
}

